import React from 'react';
import Button from 'react-bootstrap/Button';

class AddFilm extends React.Component {
    constructor(props) {
        super(props);

    }

    render() {
        return (
            <div>
                <p><Button variant="primary" onClick={props.addFilm}>I watched something!</Button></p>
            </div>
        )
    }

}







export default AddFilm;
